import React, { Component } from "react";
import HomePage from "./HomePage";
import axios from "axios";



export default class Exercises extends HomePage {
    constructor(props) {
        super(props);
        this.state = {
            workouts: []
        };
    }    
    
    render() {
        return (
            <div className="col-md-4">
                <h1>Exercises <i class="fa fa-plus"></i></h1>
                <ul id="selectionList">
                    { this.state.workouts.map( workouts => {
                        return <li key={workouts._id}><span className="plus"><i class="fa fa-plus"></i></span>{workouts.title}</li>
                    })}                   
                </ul>
            </div>
        )
    }
};
